const Banner = () => (
  <BannerContainer>
    <BannerTextBackground>
    <AudioMeter></AudioMeter>
      <BannerText>GET A FREE MIX OR MASTER BEFORE BOOKING PROJECT</BannerText>
      <CustomButton>FIND OUT HOW!</CustomButton>
    </BannerTextBackground>
  </BannerContainer>

);

export default React.memo(Banner);
